import { Link, Outlet } from "react-router-dom";

import About from "../../pages/About/About";
import Home from "../../pages/Home/Home";

function Navbar() {
    return (
        <div>
            <nav>
                <Link to="Home">Home</Link>
                <Link to="About">About</Link>
            </nav>
            <Outlet />
        </div>
    )
}

export default Navbar;
